const stockMarketData = [
	{
		stockName: 'Apple',
		ticker: 'AAPL',
		startingPrice: 70,
		monthlyGrowth: 10,
		priceRange: 200,
	},
	{
		stockName: 'Tesla',
		ticker: 'TESL',
		startingPrice: 80,
		monthlyGrowth: 10,
		priceRange: 700,
	},
	{
		stockName: 'Facebook',
		ticker: 'FB',
		startingPrice: 80,
		monthlyGrowth: 10,
		priceRange: 200,
	},
];

export default stockMarketData;
